import React, { FunctionComponent, useEffect, useRef } from "react";
import AppHeader from "../../accessories/appHeader/AppHeader";
import Footer from "../../accessories/footer/Footer";
import Button from "@material-ui/core/Button";
import { IState } from "../../../types";
import { IStateProps, TProps } from "./types";
import { useTranslation } from "react-i18next";
import { useFormik } from "formik";
import TextField from "../textField/TextField";
import "./styles.scss";


const NewBillActivity: FunctionComponent<TProps> = ({
    userCredentials
}) => {
    const { t } = useTranslation();

    const breadcrumbMap = {
        [t("nav.dashboard")]: "/",
        [t("nav.billing")]: "/billing",
        [t("nav.newbill")]: "/bills",
    };
    return (
        <div className="new_bill">
            <AppHeader
                userCredentials={userCredentials}
                breadcrumbMap={breadcrumbMap}
            />
             <div className="container">
                    <div className="new_bill__title">{t("nav.newbill")}</div>
                    <div className="date_patient">
                    <TextField
              field={formik.getFieldProps("firstName")}
              theme="regular"
              label={t("patient.firstname")}
              isValid={isValid("firstName")}
              errorText={getErrorText("firstName")}
              onBlur={formik.handleBlur}
            />
                    </div>
                </div>
            <Footer />
        </div>

    )
}

export default NewBillActivity;
